import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import "../css/exam.css";

const dummyQuestions = [
  { question: "What is 2 + 2?", options: ["1", "2", "3", "4"] },
  { question: "Which color is the sky?", options: ["Red", "Blue", "Green", "Yellow"] },
  { question: "What is the capital of India?", options: ["Delhi", "Mumbai", "Chennai", "Kolkata"] },
  { question: "What is 5 x 5?", options: ["10", "20", "25", "30"] },
  { question: "Which animal barks?", options: ["Cat", "Dog", "Cow", "Lion"] },
  { question: "What is the square root of 81?", options: ["7", "8", "9", "10"] },
  { question: "Which planet is known as the Red Planet?", options: ["Earth", "Venus", "Mars", "Jupiter"] },
  { question: "Who wrote Hamlet?", options: ["Shakespeare", "Dickens", "Tolkien", "Rowling"] },
  { question: "What is H2O?", options: ["Oxygen", "Hydrogen", "Water", "Helium"] },
  { question: "Which is a programming language?", options: ["HTML", "CSS", "Python", "Photoshop"] },
];

const Exam = () => {
  const navigate = useNavigate();
  const [showInstructions, setShowInstructions] = useState(true);
  const [showQuestions, setShowQuestions] = useState(false);
  const [timeLeft, setTimeLeft] = useState(30); // 30 seconds timer
  const [showResult, setShowResult] = useState(false);

  // Timer countdown
  useEffect(() => {
    let timer;
    if (showQuestions && timeLeft > 0) {
      timer = setInterval(() => setTimeLeft((prev) => prev - 1), 1000);
    } else if (timeLeft === 0) {
      setShowQuestions(false);
      setShowResult(true);
    }
    return () => clearInterval(timer);
  }, [showQuestions, timeLeft]);

  const handleStartExam = () => {
    setShowInstructions(false);
    setShowQuestions(true);
  };

  const handleSubmit = () => {
    setShowQuestions(false);
    setShowResult(true);
  };

  const handleReset = () => {
    setTimeLeft(30);
    setShowResult(false);
    setShowQuestions(true);
  };

  return (
    <div className="exam-container">
      {showInstructions && (
        <div className="popup instructions-popup">
          <h2>Instructions</h2>
          <ul>
            <li>Total Questions: 10</li>
            <li>Each question is multiple-choice (MCQ)</li>
            <li>Time limit: 30 seconds</li>
            <li>Click Submit to end the exam early</li>
          </ul>
          <button className="ok-btn" onClick={handleStartExam}>OK</button>
        </div>
      )}

      {showQuestions && (
        <div className="questions-section">
          <div className="timer">Time Remaining: {timeLeft} sec</div>
          {dummyQuestions.map((q, idx) => (
            <div key={idx} className="question-card">
              <h4>{idx + 1}. {q.question}</h4>
              <div className="options">
                {q.options.map((opt, i) => (
                  <button key={i} className="option-btn">{opt}</button>
                ))}
              </div>
            </div>
          ))}
          <button className="submit-btn" onClick={handleSubmit}>Submit</button>
        </div>
      )}

      {showResult && (
        <div className="popup result-popup">
          <h2>Exam Completed</h2>
          <p>Your result is: 85%</p>
          <div className="result-buttons">
            <button className="reset-btn" onClick={handleReset}>Reset</button>
            <button className="home-btn" onClick={() => navigate("das")}>Home</button>
          </div>
        </div>
      )}
    </div>
  );
};

export default Exam;
